export const BUTTON_STATUS = {
  CALL: 'call',
  ARRIVED: 'arrived',
  WAITING: 'waiting'
}

export const TIMER = {
  STOP: {
    onChange: 'stop',
    styles: {opacity: 1}
  },
  START: {
    onChange: 'start',
    styles: {opacity: 1}
  },
  RESET: {
    onChange: 'reset',
    styles: {opacity: 1}
  }
}

export const ELEVATOR_COLORS = {
  BLACK: 'black',
  RED: 'red',
  GREEN: 'green'
}
